        private void UpdateIdentityColumns(DbConnection conn, Helix6.Base.Domain.HelixEnums.EnumDBMSType DBMSType)
        {
            var tables = new List<(string Schema, string Table, string Column)>
    {
        ("Helix6_Test", "Worker", "Id"),
        ("Helix6_Test", "Worker_Project", "Id"),
        ("Helix6_Test", "WorkerAddress", "Id"),
        ("Helix6_Test", "Project", "Id"),
        ("Helix6_Test", "Course", "Id"),
        ("Helix6_Attachment", "Attachment", "Id"),
        ("Helix6_Attachment", "AttachmentFile", "Id")
    };

            conn.Open();

            foreach (var (schema, table, column) in tables)
            {
                using var command = conn.CreateCommand();

                switch (DBMSType)
                {
                    case Helix6.Base.Domain.HelixEnums.EnumDBMSType.SqlServer:
                        command.CommandText = $"DBCC CHECKIDENT ('{schema}.{table}', RESEED, 0)";
                        break;

                    case Helix6.Base.Domain.HelixEnums.EnumDBMSType.PostgreSql:
                        using (var seqCommand = conn.CreateCommand())
                        {
                            seqCommand.CommandText = $"SELECT pg_get_serial_sequence('\"{schema}\".\"{table}\"', '{column}')";
                            var sequenceName = seqCommand.ExecuteScalar() as string;

                            if (string.IsNullOrEmpty(sequenceName))
                            {
                                throw new Exception($"Sequence not found for {schema}.{table}.{column}");
                            }

                            command.CommandText = $"ALTER SEQUENCE {sequenceName} RESTART WITH 1;";
                        }
                        break;

                    default:
                        throw new NotSupportedException($"DBMSType {DBMSType} is not supported.");
                }

                command.CommandType = CommandType.Text;
                command.ExecuteNonQuery();
            }
        }
